import * as S from '../styles/MainStyle';

function Main() {
  return (
    <S.MainLayout>
      <S.MainTitle>
        국내 모든 임상시험 검색하고 <br /> 온라인으로 참여하기
      </S.MainTitle>
      <S.MainSearchInput placeholder="질환명을 입력해 주세요."></S.MainSearchInput>
    </S.MainLayout>
  );
}

export default Main;
